import React from "react";

function CarList({cart}){
    console.log(cart);
    return(
        <>
            <div>
                {cart.map((cartItem, cartIndex)=>{
                        return(
                            <div>
                                <img src={cartItem.img} width={40} />
                                <span>{cartItem.name}</span>
                                <button>+</button>
                                <button> {cartItem.quantity} </button>
                                <button>-</button>
                                <span> Rs.{cartItem.price} /-</span>
                            </div>
                        )
                    })
                }
                <p>
                    {
                        cart.map(item => item.price).reduce((cur))
                    }
                </p>
            </div>
        </>
    )
}
export default CarList;
